  `total` int(11) DEFAULT '0',
  `kode_lap_tahunan` int(11) DEFAULT NULL,
  PRIMARY KEY (`kode_lap_bulanan`),
  KEY `kode_lap_tahunan` (`kode_lap_tahunan`),
