/* Trigger structure for table `t_laporan_bulanan` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `trig_update_lap_bulanan` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `trig_update_lap_bulanan` AFTER UPDATE ON `t_laporan_bulanan` FOR EACH ROW BEGIN
	UPDATE t_laporan_tahunan a 
	SET a.total = (SELECT SUM(b.total) FROM t_laporan_bulanan b JOIN 
	(SELECT c.kode_lap_tahunan FROM  t_laporan_tahunan c ORDER BY c.kode_lap_tahunan DESC LIMIT 1) AS selekkode ON selekkode.kode_lap_tahunan = b.kode_lap_tahunan) 
	ORDER BY a.kode_lap_tahunan DESC LIMIT 1;
    END */$$


DELIMITER ;

